import React from "react";
import { useFormik } from "formik";
import * as Yup from "yup";

const intialValues = {
  username: "",
  email: "",
  password: "",
  confirmpassword: "",
};
function Login() {
  const formik = useFormik({
    intialValues: intialValues,
    onSubmit: (values) => {
      const formdata = {
        username: values.username,
        email: values.email,
        password: values.password,
      };
    },

    
  });
}
export default Login;
